import React from 'react'
import Home from './components/Home'
import './App.css'

//Redux
import { Provider } from 'react-redux'
import store from './redux/store'

export const App = () => {
  return (
    <Provider store={store}>
      <div>
        <Home/>
      </div>
    </Provider>
  )
}
